'use strict';
let PdasMessageList = require('./PdasMessageList.js');
let PdasMessageItemWithChild = require('./PdasMessageItemWithChild.js');
class PdasMessageListBuilder extends PdasMessageList {
    build(tag) {
        this.tag = tag;
        this.children = new PdasMessageItemWithChild();
        return this;
    }
}
module.exports = PdasMessageListBuilder
